import React, { useState } from "react";
import TextField from "@material-ui/core/TextField";

const SearchItem = ({ submitItem }) => {



  return (
    <div>
      <TextField
        onClick={submitItem}
        id="outlined-full-width"
        label="Search Item"
        style={{ margin: 0 }}
        placeholder="item #"
        fullWidth
        value=""
        margin="normal"
        InputLabelProps={{
          shrink: true,
        }}
        variant="outlined"
      />
    </div>
  );
};

export default SearchItem;
